import React, { Component } from 'react'
import axios from 'axios'

export default class Home extends Component {
    constructor(props) {

		super(props);

		this.state = {
			isLoading: false,
			todos: []
		}
    }

    componentDidMount() {
        axios.get('http://localhost:5000/todoApp/')
        .then(res => {
            this.setState({
                todos: res.data,
                isLoading: true
            })
        })
    }

    render() {
        return (
            <table class="table table-hover">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">Todo</th>
                        <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td><i className="bi bi-pencil-square"></i></td>
                    </tr>
                </tbody>
            </table>
        )
    }
}
